    [Benchmark]
    public void ParseWithOldWay()
    {
        var parsedRule = Rule.Split(",")
            .Where(s => !string.IsNullOrEmpty(s?.Trim()))
            .ToArray()
            .Where(x => !string.IsNullOrEmpty(x?.Trim())) // repeated since it is in the code
            .Select(x => x.Trim()).ToArray();
        var targetData = Tags.Split(',');
        
        // load imperatives
        var imperativeNegation = parsedRule.Where(r => r.StartsWith("~~")).ToArray();
        parsedRule = parsedRule.Where(r => !imperativeNegation.Contains(r)).ToArray();
