        // negation and assertions
        var negations = parsedRule.Where(x => x.StartsWith("!")).ToArray().Where(s => !string.IsNullOrEmpty(s?.Trim())).ToArray();
        var assertions = parsedRule.Where(x => !x.StartsWith("!")).ToArray().Where(s => !string.IsNullOrEmpty(s?.Trim())).ToArray();

        var result = assertions.Any(target => MatchRule(GetRuleParts(target), targetData)) && !negations.Any(target => MatchRule(GetRuleParts(target[1..]), targetData));
        bool MatchRule(string[] ruleParts, string[] tags)
        {
            if (tags is null || !tags.Any())
            {
                return false;
            }

            var result = true;
            foreach (var rule in ruleParts)
            {
                result = tags.Contains(rule);
                if (result == false) break;
            }

            return result;
        }
        
        string[] GetRuleParts(string rule) => rule.Contains(".") ? rule.Split(".").Where(t => !string.IsNullOrWhiteSpace(t)).ToArray() : new[] { rule };

    }
